import React, { Component } from 'react'
import './ServiceProviderHome.css'


class ServiceProviderHome extends Component{
    
    constructor(props) {
        super(props)
        this.state = {
            hasError: false,
            inputSearch: ""
        }
      }
    
    handelClickSerach(){
        if (this.state.inputSearch !== "null") {
            var input = this.myInput;
                var inputValue = input.value;
          alert("Input is", inputValue);
        }
    }
    render() {
        return(
              <div>
                  <h5 style={{textAlign: "center"}}>Searching patient by key</h5>
                  <div class="cover">
                      <div className="divFrom" ref="searchInput">     
                          <input type="search" onClick={this.handelClickSerach()} />
                              <i class="fa fa-search"></i>
                      </div>
                  </div>
              </div>
          );
      }
}

export default ServiceProviderHome;
